// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.7.0 <0.9.0;

import "./Item.sol";

//Should probably use SafeMath

contract Buyer is ItemFactory {
    
    address owner;
    Item[] myItems;
    
    event BoughtItem(Item _item);

    constructor(address _owner){
        owner = _owner;
    }

    function addItem(Item memory _item) public {
        for(uint i = 0 ; i < myItems.length ; i++){
            if(keccak256(abi.encodePacked(myItems[i].name)) == keccak256(abi.encodePacked(_item.name)) && myItems[i].owner == _item.owner){
                console.log("current buyer quantity = ", myItems[i].quantity);
                uint cur_quantity = myItems[i].quantity;
                myItems[i].quantity = cur_quantity + 1;
                emit BoughtItem(_item);
                return;
            }
        }

        myItems.push(_item);
        emit BoughtItem(_item);
    }

    function getItems() public view returns(Item[] memory) {
        return(myItems);
    }

}

contracts/Item.sol.content:
// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.7.0 <0.9.0;

//Should probably use SafeMath
import "hardhat/console.sol";

contract ItemFactory {

    struct Item{
        uint id;
        string name;
        address owner;
        uint quantity;
    }

    Item[]  items;
    uint  id = 0;
    mapping (uint => address) itemsToOwner;

    event ItemCreated(string _name, address _owner, uint _itemId, uint quantity);
    event OwnershipChange(uint _itemId, address _oldOwner, address _newOwner);

    function createItem(string memory _name, address _owner) internal returns (uint) {

        for(uint i = 0 ; i < items.length ; i++){
            if(keccak256(abi.encodePacked(items[i].name)) == keccak256(abi.encodePacked(_name)) && items[i].owner == _owner){
                console.log("current item quantity (in createItem function) =  ", items[i].quantity);
                uint cur_quantity = items[i].quantity;
                items[i].quantity = cur_quantity + 1;
                emit ItemCreated(_name, _owner, i, items[i].quantity);
                return i;
            }
        }

        items.push(Item(id, _name, _owner, 1));
        itemsToOwner[id] = _owner;
        console.log("from Item items length = ", items.length );
        id++;
        emit ItemCreated(_name, _owner, id, 1);
        return (id-1);
    }

    function getExistingItems() public view returns (Item[] memory){
        return items;
    }
    //remove item 
    function removeItem(string memory _name, address _owner) internal{
        for(uint i = 0 ; i < items.length ; i++){
            if(keccak256(abi.encodePacked(items[i].name)) == keccak256(abi.encodePacked(_name)) && items[i].owner == _owner){
                console.log("current item quantity (in removeItem function) = ", items[i].quantity);
                uint cur_quantity = items[i].quantity;
                if(cur_quantity > 1){
                    cur_quantity = cur_quantity - 1;
                    Item memory ret = items[i];
                    ret.quantity = cur_quantity;
                    items[i] = ret;
                } else {
                    items[i] = items[items.length - 1];
                    items.pop();
                }    
            }
        }
    }

    //for buyer change ownership
    

}

contracts/Marketplace.sol.content:
// SPDX-License-Identifier: GPL-3.0
pragma solidity >=0.7.0 <0.9.0;


import "./Supplier.sol";
import "./Buyer.sol";
import "hardhat/console.sol";

//Should probably use SafeMath

contract Marketplace is ItemFactory {

    mapping (address => uint) suppliersMap;
    mapping (address => uint) buyersMap;

    Supplier[] suppliers;
    uint supplierCount = 1;

    Buyer[] buyers;
    uint buyerCount = 1;

    modifier notSupplier{
        require (suppliersMap[msg.sender] == 0);
        _;
    }

    modifier isSupplier{
        require (suppliersMap[msg.sender] != 0);
        _;
    }

    modifier isBuyer{
        require (buyersMap[msg.sender] != 0);
        _;
    }

    modifier notBuyer{
        require (buyersMap[msg.sender] == 0);
        _;
    }

    function bSupplier() external view returns (bool ){
        if( suppliersMap[msg.sender] == 0)
            return false;
        else 
            return true;
    }

    function bBuyer() external view returns (bool ){
        if(buyersMap[msg.sender] == 0)
            return false;
        else
            return true;
    }

    function becomeSupplier() public notSupplier {
        Supplier sup = new Supplier(msg.sender);
        suppliers.push(sup);
        suppliersMap[msg.sender] = supplierCount;
        supplierCount++;
    }

    function becomeBuyer() public notBuyer {
        Buyer buy = new Buyer(msg.sender);
        buyers.push(buy);
        buyersMap[msg.sender] = buyerCount;
        buyerCount++;
    }

    // Methods for suppliers
    function createItem(string memory _name) public isSupplier {
        suppliers[suppliersMap[msg.sender] - 1].addItemToInventory(_name, msg.sender);
    }

    function removeItem(string memory _name) public isSupplier{
        suppliers[suppliersMap[msg.sender] - 1].removeItemFromInventory(_name, msg.sender);

    }

    // Methods for Buyers
    function buyItem(address _supplier, string memory _itemName) public isBuyer {
        Item memory item = suppliers[suppliersMap[_supplier]-1].sellItem(_itemName);
        item.owner = msg.sender;
        buyers[buyersMap[msg.sender]-1].addItem(item);
    }

    // Methods for Everyone
    function getInventory(address _supplier) public view returns (Item[] memory) {
        // require(suppliersMap.length > 0);
        return (suppliers[suppliersMap[_supplier]-1].getInventory());
    }

    function getItems(address _buyer) public view returns (Item[] memory) {
        return (buyers[buyersMap[_buyer]-1].getItems());
    }

    function getAllItems() public view returns (Item[] memory){
        Item[] memory cur_items;
        if(suppliers.length > 0){
            return suppliers[0].getCurrentItems();
        } else {
            return cur_items; //returns empty array
        }
    //    for(uint i = 0 ; i < cur_items.length ; i++){
    //       console.log(cur_items[i].name);
    //    }
        // return cur_items;
    }
}

